import React from 'react';
import { Icon } from '@iconify/react';
import umlogo from '../assets/images/umlogo.svg';

const DashboardSidebar = () => {
  return (
    <div className="absolute top-0 left-0 h-full z-10 p-6">
        <div className="w-20 bg-white bg-opacity-30 text-white rounded-xl flex flex-col gap-y-4">
            <div className="flex flex-col gap-3 justify-center items-center pt-12">
                <img src={umlogo} className="w-10" alt="um-logo"/>
                <p className="font-light text-sm">urbanMind</p>
            </div>
            <hr className="h-0.5" style={{ color: '#000000', backgroundColor: '#ffffff', height: .5, borderColor : '#ffffff'}}/>
            <div className="flex flex-col gap-3 justify-center items-center mt-5">
                <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
                <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
                <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
                <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
                <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
                <Icon icon="heroicons:home-20-solid" width="24" style={{ color: "#ffffff" }} />
            </div>
        </div>
    </div>
  );
};

export default DashboardSidebar;
